import React, { Fragment } from 'react';
import AppPass from './Apppass';



const AppHome = () => {
    
    const dummyTodos = [
        {
          id: 1,
          title: 'Todo App Test',
          desc: 'Todo App md ismail'
        },
        {
            id: 2,
            title: 'Todo App Test',
            desc: 'Todo App md ismail'
          }
    ];

       return (
           <Fragment>
               <AppPass TodoPass={dummyTodos} />
           </Fragment>
       );
   };
   export default AppHome;
